import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { ImageComparison } from './ImageComparison';


function Examples() {
  return (
	<Container className="pt-5 mt-5">
		<Row>
			<Col>
				<h1 className = "display-5 fw-bold text-align-center">Cleaning Examples</h1>
				<p className = "text-align-center">Slide on the image to view before and after photos of our work.</p>		

			</Col>
			<Col>
				<ImageComparison />
			</Col>
		</Row>
	</Container>
  );
}

export default Examples;
